- input: "TEXT\x1CC00481341\x1C.TEXT\x1C\x1CF3A\x1CThis letter is in response to your
    Request for Additional Information sent to Art Robinson for Congress on June 24,
    2010 regarding donor identification and Best Efforts.  The committee has provided
    the names and addresses of its donors as they were provided to the committee.
    \ The committee has since made an effort to obtain the full name of each donor
    to satisfy FEC requirements and filed the attached amended Pre-Primary report
    with updated identification information.  The committee has sent letters by mail
    to all donors contributing over $200 to obtain employer and occupation information
    if it was not originally provided.  Our notice informed the contributor of the
    federal requirements for reporting such information, and the committee includes
    a pre-addressed return envelope with every request sent by mail. Written records
    are kept documenting such requests.  All solicitations include a clear and obvious
    request and inform the contributor of the requirements of federal law for the
    reporting of such information.  The committee has filed an amended Pre-Primary
    report that reflects its efforts to obtain employer and occupation information.\n"
